import { InputGroup, InputGroupText, Input } from "reactstrap";

function Lighting({triggers, index}) {
    return (
        <>
            <h3>Lighting</h3>
            <p>Eye Accom: {triggers[index].EyeAccommodation}</p>
            <p>Inter Speed: {triggers[index].InterpolationSpeed}</p>
            <InputGroup id='inputGroup'>
                <InputGroupText>Eye Accom</InputGroupText>
                <Input placeholder={triggers[index].EyeAccommodation}></Input>
            </InputGroup>
            <br />
            <InputGroup id='inputGroup'>
                <InputGroupText>Inter Speed</InputGroupText>
                <Input placeholder={triggers[index].InterpolationSpeed}></Input>
            </InputGroup>
            <br />
        </>
    );
}

export default Lighting;
